INSERT INTO `lifeline_agrements_items` VALUES (1,'initials_1','I (or my dependent or other person in my household) currently get benefits from the government program(s) listed on this form or my annual household income is 135% or less than the Federal Poverty Guidelines (the amount listed in the Federal Poverty Guidelines table on this&nbsp;form).',1,'all'),(2,'initials_2','I agree that if I move I will give my service provider my new address within 30&nbsp;days.',1,'all'),(3,'initials_3','I understand that I have to tell my service provider within 30 days if I do not qualify for Lifeline anymore, including:<br> 1.) I, or the person in my household that qualifies, do not qualify through a government program or income anymore.<br> 2.) Either I or someone in my household gets more than one Lifeline benefit (including more than one Lifeline broadband internet service, more than one Lifeline telephone service, or both Lifeline telephone and Lifeline broadband internet&nbsp;services).',1,'all'),(4,'initials_4','I know that my household can only get one Lifeline benefit and, to the best of my knowledge, my household is not getting more than one Lifeline&nbsp;benefit.',1,'all'),(5,'initials_5','I agree that all of the information I provide on this form may be collected, used, shared, and retained for the purposes of applying for and/or receiving the Lifeline Program benefit. I understand that if this information is not provided to the Lifeline Program Administrator, I will not be able to get Lifeline benefits. If the laws of my state or Tribal government require it, I agree that the state or Tribal government may share information about my benefits for a qualifying program with the Lifeline Program Administrator. The information shared by the state or Tribal government will be used only to help find out if I can get a Lifeline Program&nbsp;benefit.',1,'all'),(6,'initials_6','All the answers and agreements that I provided on this form are true and correct to the best of my&nbsp;knowledge.',1,'all'),(7,'initials_7','I know that willingly giving false or fraudulent information to get Lifeline Program benefits is punishable by law and can result in fines, jail time, de-enrollment, or being barred from the&nbsp;program.',1,'all'),(8,'initials_8','My service provider may have to check whether I still qualify at any time. If I need to recertify (renew) my Lifeline benefit, I understand that I have to respond by the deadline or I will be removed from the Lifeline Program and my Lifeline benefit will&nbsp;stop.',1,'all'),(9,'initials_9','The certification below applies to all consumers and is required to process your application. I was truthful about whether or not I am a resident of Tribal lands, as defined in section 2 of this&nbsp;form',1,'all'),(10,'initials_10','I understand that violating the one-per-household benefit rule is against the California Lifeline rules and may result in me losing my California Lifeline benefit, and potentially, prosecution by the United States government.',1,'CA');
